import React, { Component } from 'react';
import View from "./View.js";
import Model from "./Model.js";
import yaml from "yaml-js";
import './App.css';

class App extends Component {

  static data = yaml.load(`
content: null
completed: null
children:
  - content: Note1
    note: null
    completed: false
    children: []
  - content: Note2
    note: Note2 Note
    completed: true
    children:
      - content: Note2a
        note: null
        completed: false
        children: []
      - content: Note2b
        note: null
        completed: false
        children: []
`);

  constructor(props) {
    super(props);
    this.state = {
      model: new Model(this.data)
    }
  }

  componentDidMount() {
  }

  render() {
    return (
      <div className="Page">
        <View model={ this.state.model }></View>
      </div>
    );
  }
}

export default App;
